INSERT  INTO `user_profile_dangerous_bet_rule`(`id`,`dangerous_code`,`sport_id`,`rule_name`,`rule_detail`,`parameter1`,`parameter2`,`parameter3`,`parameter4`,`enable`) VALUES 
(1,'d1',0,'蛇单投注','赛前阶段，同时满足以下2个条件的注单，标记为“蛇单投注”：1、注单金额>=1000元（参数1）;2、下注10秒内（参数2）赔率跳水到Y，然后60秒内（参数3）赔率没有回到原值X','1000','10','60','',1),
(2,'d2',0,'蛇单投注','"滚球阶段，同时满足以下6个条件的注单，标记为“蛇单投注”：1、注单金额>=1000元（参数1）;2、大小类玩法，Pdid：2、10、11、13、18、26、34、87、88、97、98、102、109、110、114、115、116、122、123、124、127、134、217、233;3、下注10秒内（参数2）赔率跳水到Y，然后30秒内（参数3）赔率没有回到原值X;4、注单欧赔>1.9（参数4）;5、注单欧赔>=supremacy（supremacy=球头-(1-马来赔)   ） 【注：若马来赔为负，则supremacy=球头-(1+马来赔)】;6、注单赔率> SR赔率"
